#range(1,100)
#Write a program that prints the numbers from 1 to 100. But 
#for multiples of 3 print “Fizz”, instead of multiples of 5 print 
#“Buzz”, and for multiples of both 3 and 5 print “FizzBuzz”.

for number in range(1,101):
    if (number%3== 0 and number%5== 0):
        print('Fizzbuzz')
    if(number%3== 0):
        print('Fizz')                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                     
    if number%5== 0:
        print('buzz')
    else:
        print(number)
       
            
   
    
    

